import React from 'react';
import ReactDOM from 'react-dom';

// теперь корневой компонент у нас не App, а Root
import Root from './components/Root';

// поменяли css на scss
import './index.scss';

ReactDOM.render(
    <React.StrictMode>
        <Root />
    </React.StrictMode>,
    document.getElementById('root'),
);
